        <div className="expenses">
            {props.items.map((expense)=>(
            <ExpenseItem 
             title={expense.title}
             amount={expense.amount} 
             date={expense.date}
             />))}//return every expense in ExpenseItem
      </div>
///////////////////////////////////

    )
}
export default Expenses;
